import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <svg id="rocket-smoke" alt="Rocket Ship Smoke" xmlns="http://www.w3.org/2000/svg" width="516.119" height="1083.632" viewBox="0 0 516.119 1083.632"></svg>
    </div>
  );
}

export default App;
